import React from "react";
import { Link } from "react-router-dom";
import Aos from "aos";
import 'aos/dist/aos.css';
import "../styles/App.css";
import "../styles/Buttons.css";
import "../styles/Home.css";
import TypingEffect from "../components/TypingEffect";


function Home() {
  // const textToDisplay = "Nico"


  React.useEffect (() => {
    Aos.init({ duration: 1000 });
  }, []);

  return (
    <div className="container-fluid">
      <div className="home-grid">
        <div data-aos='zoom-in'>
        <div class="justify-content-left text-align-left">
          <p className='text-mobile'>Hi there, my name is</p>
          <TypingEffect text="Nico" className="custom-typing-effect title" />

          <p className="text-mobile">And I'm a <strong>UI Developer</strong></p>
          <div className='line-left'></div>
          <div>
            <Link to="/portfolio"> {/*data-aos="fade" data-aos-offset="100"*/}
              <button className="material-bubble" style={{ margin: "3rem 1rem"}}>Get to know me</button>
            </Link>
          </div>
        </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
